.docApply {
    width: 500px;
    padding: 20px;
    .title {
        border-radius: 8px;
        background: #79ac43;
        color: #fff;
        cursor: default;
    }
    .el-button {
        border-radius: 8px;
        background: #79ac43;
        color: #fff;
    }
    ::v-deep .el-form {
        .el-form-item__label {
            border-radius: 8px;
            background: #79ac43;
            color: #fff;
            text-align: center;
            padding: 0;
            font-weight: 400;
        }
        .el-form-item__content {
            padding-left: 20px;
        }
    }
}
